        pageTitle: document.title,
        profileVisible: profilePage.classList.contains('active'),
        profileUsername: profilePage.querySelector('.profile-username')?.textContent,
        profileFollowers: profilePage.querySelector('.followers-count')?.textContent
      };
    });

    return {
      success: true,
      action: "Clicked Profile menu in sidebar and navigated to profile page",
      extractedData: profileData || { message: "Profile page detected" },
      screenshots,
      error: null
    };
